- input: "TEXT\x1CC00477323\x1C.TEXT\x1C\x1CF3A\x1CThis amendment is in response to
    the notice dated 6/29/11.  The contribution from Alliant was corrected to select
    it as a PAC with an FEC #.  The Digestive Health Center, P.A. contribution is
    being refunded.  $2,500 of the Jap Sells is being refunded since this is a sole
    proprietorship.  London and Stelelman is a partnership and was noted and split
    between the 2 partners.  The 2 contributions from non registered committees were
    noted as being federally permissible funds.  Chainco Two, LLC is a one member
    LLC and was split to the one member.  Cheyenne Properties, LLC is a one member
    LLC and was split to the member.  Conn Enterprises contribution of $2,500 was
    refunded.  Curry and Curry PLLC contribution of $250 was refunded.  Michael Fritz
    Development, LLC is a partnership and is split between the 2 partners.  Pas-Point
    Anesthesia, PLLC is a one member LLC  and the contribution is attributed to the
    one member.  St. Pe' and Associates LLC is a partnership and the contribution
    is split between the partners.\n"
